async function fetch_calendar(token) {
    const url = 'http://220.88.39.23:5000/api/calendar/past_events';

    try {
        const response = await fetch(url, {
            method: 'GET',
            headers: {
                'Authorization': `Bearer ${token}`,
                'Content-Type': 'application/json', // 可选
            }
        });

        if (!response.ok) {
            throw new Error("Failed to fetch calendar events!");
        }

        const calendar_data = await response.json();
        console.log("Calendar Data:", calendar_data); // 输出数据到控制台
        setData(calendar_data); // 假设 setData 是一个更新状态的函数

